  const saltRounds = 10;
  const hash = await bcrypt.hash(body.password, saltRounds);
  console.log("Inside Service", body.password);
  body.password = hash;
  const data = User.findOneAndUpdate({ email: body.email }, { password: body.password }, { new: true });
  return data;
};

